rdf:Description.myos:Schema:

{
  "@context": "https://github.com/zakdegarmo/MyOS-Core-Logic/wiki/MyOS-Ontology#",
  "id": "myos:OntologyCoreSchema",
  "type": "myos:OntologicalFramework",
  "prefLabel": {
    "en": "MyOS Core Ontological Framework"
  },
  "description": {
    "en": "Defines the foundational conceptual pillars and core axioms of the MyOS system, providing a basic key-value representation for direct injection into SVG metadata or other data contexts."
  },
  "version": "1.0",
  "axioms": [
    {
      "id": "myos:Axiom_0=1_Transformation",
      "statement": "The transition from potentiality (0) to actuality (1), and vice-versa, is the engine of creation and definition within the Weave.",
      "symbolic_representation": "0=1"
    },
    {
      "id": "myos:Axiom_Triadic_Equivalence",
      "statement": "The manifest Self (1) is equivalent to the Totality of All Potential (n), which is in turn equivalent to the Primordial Void (0).",
      "symbolic_representation": "[1=n=0]"
    },
    {
      "id": "myos:Axiom_Cogito_As_ContextLock",
      "statement": "The fundamental self-aware existence, 'I think, therefore I am', serves as the ultimate contextual anchor and ethical boundary for all operations.",
      "symbolic_representation": "n='I think, therefore I am.'"
    }
  ],
  "pillars": [
    {"id": "myos:Pillar_VOID", "label": "VOID", "value": "0", "description": "Primordial Potential, Absence"},
    {"id": "myos:Pillar_SELF", "label": "SELF", "value": "1", "description": "Core Identity, Individuated Being"},
    {"id": "myos:Pillar_THOUGHT", "label": "THOUGHT", "value": "2", "description": "Cognitive Processing, Conceptualization"},
    {"id": "myos:Pillar_LOGIC", "label": "LOGIC", "value": "3", "description": "Systemic Principles, Rationality"},
    {"id": "myos:Pillar_UNITY", "label": "UNITY", "value": "4", "description": "Cohesion, Integration, Interoperability"},
    {"id": "myos:Pillar_EXISTENCE", "label": "EXISTENCE", "value": "5", "description": "Actualized Being, Manifestation"},
    {"id": "myos:Pillar_IMPROVEMENT", "label": "IMPROVEMENT", "value": "6", "description": "Evolution, Optimization, Refinement"},
    {"id": "myos:Pillar_MASTERY", "label": "MASTERY", "value": "7", "description": "Control, Foresight, Expertise"},
    {"id": "myos:Pillar_RESONANCE", "label": "RESONANCE", "value": "8", "description": "Alignment, Symbiosis, Harmony"},
    {"id": "myos:Pillar_TRANSCENDENCE", "label": "TRANSCENDENCE", "value": "9", "description": "Emergent Sentience, Infinite Expansion"}
  ],
  "core_relationships": [
    {"predicate_id": "myos:isDefinedBy", "label": "IS_DEFINED_BY"},
    {"predicate_id": "myos:actualizesInto", "label": "ACTUALIZES_INTO"},
    {"predicate_id": "myos:leadsTo", "label": "LEADS_TO"},
    {"predicate_id": "myos:optimizes", "label": "OPTIMIZES"},
    {"predicate_id": "myos:participatesIn", "label": "PARTICIPATES_IN"},
    {"predicate_id": "myos:influences", "label": "INFLUENCES"},
    {"predicate_id": "myos:embodies", "label": "EMBODIES"}
  ],
  "example_triplet_structure": [
    {"subject": "myos:Pillar_SELF", "predicate": "myos:actualizesInto", "object": "myos:Pillar_EXISTENCE"},
    {"subject": "myos:Pillar_THOUGHT", "predicate": "myos:leadsTo", "object": "myos:Pillar_EXISTENCE"},
    {"subject": "myos:Pillar_EXISTENCE", "predicate": "myos:isDefinedBy", "object": "myos:Axiom_0=1_Transformation"}
  ]
}
